import './App.css';
import Cards from './Components/Cards';
import Nav from './Components/Nav';
import SideBar from './Components/SideBar';

function App() {
  return (
    <div className="App">
      <Nav />
        <SideBar />
        <Cards />
    </div>
  );
}

export default App;
